            Integer n1 = Integer.parseInt(register1.value);
            register.type = "constante";
            switch(operator.value) {
                case "+" : {
                    register.value = String.valueOf(n1 + n2);
                    break;
                }
                case "-" : {
                    register.value = String.valueOf(n1 - n2);
                    break;
                }
                case "/": {
                    register.value = String.valueOf(n1 / n2);
                    break;
                }
                // mul case
                default : {
                    register.value = String.valueOf(n1 * n2);
                }
            }
            
